import styles from "./MainPage.module.css"

import Banner from "../../components/Banner/Banner";
import Bestellers from "../../components/Bestsellers/Bestellers";


const MainPage = () => {
  return (
    <div className={styles.main_main_page}>
      <Banner/>
      <Bestellers/>
    </div>
  );
}

export default MainPage;
